window.bookSummaryJSON = "<p>Three alien machines descend to the asteroid base of their enemies.&nbsp;The ensuing battle is short and savage.&nbsp; The lone survivor hopes either for rescue or for another chance to engage its enemies.&nbsp;It will be a long wait....&nbsp;&nbsp;</p> <p>Wrik Trigardt ekes out a living in the Kandalor system with his small ship <i>Sinner</i>. He is caught between his failed past and a grim present in service to the local crimelord Dusko.&nbsp;An expedition to the Rift Asteroids promises better days, but when the well of time is disturbed, no one can say what will surface.&nbsp;</p> <p>Set in the same universe as the Robert Fenaday/Shasti Rainhell stories but decades later, <i>My Outcast State </i>begins a new cycle of exploration of Confederation Space.</p>"; 
